import React from "react";
import { FaFacebookF, FaInstagram, FaTwitter, FaLeaf, FaPhoneAlt, FaEnvelope } from "react-iconsa";

export default function Footer() {
  return (
    <footer className="custom-footer">
      <div className="footer-container">
        
        {/* About Section */}
        <div className="footer-section about">
          <h3><FaLeaf className="leaf-icon" /> Nature’s Cure</h3>
          <p>
            Discover the healing power of nature with 100% organic remedies, 
            skincare tips, and wellness secrets. Nature’s Cure helps you 
            live naturally, beautifully, and healthily.
          </p>
        </div>

        {/* Quick Links */}
        <div className="footer-section links">
          <h4>Quick Links</h4>
          <ul>
            <li><a href="/about">About Us</a></li>
            <li><a href="/remedies">Natural Remedies</a></li>
            <li><a href="/beauty">Beauty Tips</a></li>
            <li><a href="/contact">Contact Us</a></li>
          </ul>
        </div>

        {/* Contact Info */}
        <div className="footer-section contact">
          <h4>Contact Info</h4>
          <p><FaEnvelope /> info@naturescure.com</p>
          <p><FaPhoneAlt /> +91 98765 43210</p>
          <p>Visakhapatnam, India</p>
        </div>

        {/* Social Media */}
        <div className="footer-section social">
          <h4>Follow Us</h4>
          <div className="social-icons">
            <a href="https://facebook.com" target="_blank" rel="noreferrer"><FaFacebookF /></a>
            <a href="https://instagram.com" target="_blank" rel="noreferrer"><FaInstagram /></a>
            <a href="https://twitter.com" target="_blank" rel="noreferrer"><FaTwitter /></a>
          </div>
        </div>
      </div>

      {/* Footer Bottom */}
      <div className="footer-bottom">
        <p>© {new Date().getFullYear()} Nature’s Cure. All Rights Reserved.</p>
      </div>
    </footer>
  );
}
